import React from "react";
import ModalSignUp from "../../components/SignUp";
import ModalSignIn from "../../components/SignIn";
import { Button } from "react-bootstrap";

export default function LandingPage() {
  const [modalShow, setModalShow] = useState(false);
  const [modaSignInlShow, setModaSignInlShow] = useState(false);

  return (
    <div>
      This is Landing Pages
      <div className="button-container">
        <Button clicked={() => setModalShow(true)} btnName="Sign Up" color="sign-up" />
        <Button clicked={() => setModaSignInlShow(true)} btnName="Sign In" color="sign-in" />
      </div>
    </div>
  );
}
